import './App.css'
import axios from 'axios'

function App() {
  const meteolyon = () => {
    axios.get("http://api.openweathermap.org/data/2.5/weather?q=Lyon&appid=8c2dbdca747ed150544b60e2ae60fbf1")
  }
  return (
    <div className="App">
      <span className="heading">React Meteo</span>
    </div>
    )
}

export default App




